	(typeof(window) === 'undefined' ? global : window).I18n.translations["de"] = {"web":{"admin":{"onboarding":{"guide":{"back_to_todo":"Zurück zur Aufgabenliste","cover_photo":{"add_your_own":"Titelbild hinzufügen","advice":{"alt":"Wie bekomme ich gut aussehende Titelbilder, Logos, Favicons, Profil- und Eintragsbilder? (Englisch)","content1":"Du solltest %{link} lesen, wo wir erzählen wo du gute, frei wendbare Bilder finden kannst. Leider ist die Anleitung zur Zeit nur auf Englisch vorhanden.","content2":"Achtung: Das Foto wird auf die Größe von %{width}x%{height} Pixel geändert. Wenn das Foto höher ist, werden die Ober- und Unterteile abgeschnitten.","link":"unsere Anleitung"},"description":"Die Qualität deines Titelbildes kann es stark beeinflussen, ob neue Kunden deinem Marktplatz beitreten oder nicht.","info_image_alt":"Ein Screenshot von einem Homepage mit einem großen Titelbild","title":"Schritt 3: Titelbild hinzufügen"},"filter":{"add_fields_and_filters":"Felder und Filter hinzufügen","advice":{"content":"Felder sind ziemlich Nützlich, aber %{not_too_many_link}. Zu viele Filter können deine Kunden überwältigen, und jeder Filter ist ein zusätzliches Feld, das deine Anbieter ausfüllen müssen.","not_too_many_link":"du solltest nicht zu viele hinzufügen"},"description":{"content":"Eintragsfelder definieren die Struktur deines Marktplatzes. Wenn du zum Beispiel einen Markplatz für gebrauchte Schuhe erstellen willst, solltest du ein Feld für die Schuhgröße hinzufügen. Der Verkäufer muss dann die Schuhgröße eingeben, wenn er einen Eintrag für Schuhe erstellen will. Wenn du es deinen Kunden erlauben willst, dass sie Einträge anhand der Schuhgröße filtern können, kannst du %{display_on_homepage} beim Hinzufügen des Feldes auswählen.","display_on_homepage":"Als Filter auf der Homepage anzeigen"},"info_image_alt":"Ein Screenshot von der 'Eintragsfelder \u0026 Filter' -Seite","title":"Schritt 4: Eintragsfelder und Filter hinzufügen"},"invitation":{"advice":"Du kannst zuerst deine Freunde einladen, und Feedback von ihnen sammeln.","description":{"content":"Bist du damit zufrieden, wie dein Marktplatz aussieht und funktioniert? Vielleicht willst du %{preview_link}? Wenn du bereit bist, lass uns Benutzer einladen!","preview_link":"noch einmal vorschauen","preview_link_alt":"Vorschau anzeigen"},"info_image_alt":"Benutzer-Darstellung","invite_users":"Benutzer einladen","title":"Schritt 7: Benutzer einladen"},"listing":{"advice":{"close_listing":"Eintrag schließen","content":"Es ist einfach, einen Eintrag zu entfernen: einfach auf den Eintrag klicken und %{close_listing} auswählen."},"description":"Einträge sind der Inhalt deines Marktplatzes: Die Waren oder Dienstleistungen, die deine Anbieter anbieten. du kannst einen neuen Eintrag erstellen, damit du den Prozess kennen lernst und dein Marktplatz nicht so leer aussieht!","info_image_alt":"Ein Screenshot von der 'Neuen Eintrag hinzufügen' -Seite","post_your_first_listing":"Deinen ersten Eintrag hinzufügen","title":"Schritt 6: Deinen ersten Eintrag erstellen"},"next_step":{"cover_photo":"Titelbild hinzufügen","filter":"Felder und Filter hinzufügen","invitation":"Benutzer einladen","listing":"Deinen ersten Eintrag erstellen","paypal":"Zahlungssystem einrichten","slogan_and_description":"Slogan \u0026 Beschreibung hinzufügen"},"paypal":{"advice":{"content":"Du kannst mehr über das Deaktivieren von Zahlungen %{disable_payments_link} lesen. Leider ist dieser Artikel nur auf Englisch vorhanden.","disable_payments_alt":"Wie man Zahlungen deaktiviert oder kostenlose Einträge auf den Marktplatz erstellt (Englisch)","disable_payments_link":"hier"},"cta_separator":"oder","description_p1":"Wenn deine Anbieter Zahlungen für ihre Waren oder Dienstleistungen annehmen können sollten, solltest du dein PayPal-konto verbinden (Du bekommst eine Provision für jede Transaktion). Sobald du das Konto verbunden hast, kannst du den Mindestbetrag einer Transaktion und deine Transaktionsgebühr feststellen.","description_p2":"Wenn du willst, kannst du Online-Zahlungen auch fürs Erste deaktivieren.","disable_payments":"Zahlungen deaktivieren","info_image_alt":"Ein Screenshot von der 'Zahlungssystem' -Seite","setup_payments":"Zahlungen einrichten","title":"Schritt 5: Zahlungssystem einrichten"},"slogan_and_description":{"add_your_own":"Slogan \u0026 Beschreibung hinzufügen","advice":{"content":"Verwende deinen Slogan um deinen Marktplatz schnell zu beschreiben. %{food_from_locals_slogan} oder %{guitar_lessons_slogan} sind gute Beispiele. Mit der Beschreibung kannst du ergänzen, wofür dein Marktplatz nützlich ist. %{food_from_locals_description} oder %{guitar_lessons_description} sind gute Beispiele.","food_from_locals_description":"\"Durch FoodMarket kannst du einfach Produkte direkt von einheimischen Anbietern kaufen\"","food_from_locals_slogan":"\"Regionale lebensmittel kaufen\"","guitar_lessons_description":"\"GuitarPro ist der beste Ort um Musiklehrer zu vergleichen\"","guitar_lessons_slogan":"\"Gitarrenunterricht von einem Profi\""},"description":"Der Slogan und die Beschreibung zeigen neue Benutzer, was dein Marktplatz anbietet. Das sehen sie als erstes wenn sie deinen Marktplatz ansehen, also sollten sie kurz aber auch beschreibend sein.","info_image_alt":"Ein Screenshot von dem Homepage mit Slogan und Beschreibung.","title":"Schritt 2: Slogan \u0026 Beschreibung hinzufügen"},"status_page":{"congratulation_p1":{"content":"Du hast es geschafft! Dein Marktplatz ist eingerichtet. Das ist aber nur der Anfang. Du hast nur ein kleines Teil von den Anpassungsmöglichkeiten von Sharetribe gesehen. Um mehr Informationen über die Anpassung deines Marktplatzes zu bekommen, solltest du %{knowledge_base_link} ansehen. Die meisten Artikel sind leider zur Zeit nur auf Englisch verfügbar.","knowledge_base_alt":"knowledge base","knowledge_base_link":"unseren Knowledge Base"},"congratulation_p2":{"content":"Wenn du mehr darüber lernen willst, wie man ein erfolgreiches Marktplatz-Geschäft führt, empfehlen wir den Artikel %{marketplace_guide_link}. Leider ist dieser Artikel auch zur Zeit nur auf Englisch verfügbar.","marketplace_guide_alt":"link to marketplace academy","marketplace_guide_link":"Leitfaden für das erfolgreiche Aufbauen von Online Marktplatz-Geschäften"},"congratulation_p3":{"contact_support_link":"unser Support-Team","contact_support_title":"Support","content":"Wenn du fragen hast, kannst du gerne %{contact_support_link} kontaktieren, wir sind für dich da!"},"cover_photo":"Titelbild hochladen","create_your_marketplace":"Deinen Marktplatz erstellen","description_p1":"Um deinen Marktplatz einzurichten, gibt es einige wichtige Schritte die du nehmen solltest. Die siehst du unten.","description_p2":"Sobald du fertig bist, ist dein Marktplatz bereit für die ersten Kunden!","filter":"Felder und Filter hinzufügen","invitation":"Benutzer einladen","listing":"Einen Eintrag erstellen","paypal":"Zahlungssystem einrichten","slogan_and_description":"Slogan \u0026 Beschreibung hinzufügen","title":"Willkommen auf deinen Marktplatz, %{name}","title_done":"Alles fertig!"}},"topbar":{"cover_photo":"Titelbild hochladen","filter":"Felder und Filter hinzufügen","invitation":"Benutzer einladen","listing":"Eintrag erstellen","next_step":"Als nächstes","paypal":"Zahlungen empfangen","progress_label":"Fortschrittsanzeige","slogan_and_description":"Slogan \u0026 Beschreibung hinzufügen"}}},"branding":{"create_own":"Want to create your own online marketplace website like %{service_name}? %{learn_more}.","learn_more":"Learn more","powered_by":"%{service_name} is powered by the %{sharetribe_link} marketplace platform."},"listing_card":{"no_picture":"No picture"},"listings":{"pricing_units":{"day":"day","hour":"hour","month":"month","night":"night","piece":"piece","week":"week"}},"no_listings":{"sorry":"Sorry, no listings could be found for your search criteria.","try_other_search_terms":"Maybe try other search terms?"},"topbar":{"admin_dashboard":"Administrator Dashboard","inbox":"Eingang","language":"Sprache","login":"Anmelden","logout":"Abmelden","manage_listings":"Einträge verwalten","menu":"Menü","more":"Mehr","profile":"Profil","search_location_placeholder":"Ort","search_placeholder":"Suche ...","settings":"Einstellungen","signup":"Registrieren","user":"Nutzer"},"utils":{"km":"km","mi":"mi"}}};
